def scriptResult = ""

Transaction tx = persistence.createTransaction()
try {
    EntityManager em = persistence.getEntityManager()

    for (d in districts) {
        District district = new District()
        district.setId(UUID.fromString(d[0]))
        district.setName(d[1])
        district.setPolygon(GeometryUtils.wktStringToPolygon(d[2]))
        em.persist(district)
    }

    scriptResult += 'Districts have been imported successfully\n'

    for (c in clinics) {
        Clinic clinic = new Clinic()
        clinic.setId(UUID.fromString(c[0]))
        clinic.setName(c[1])
        clinic.setLocation(GeometryUtils.wktStringToPoint(c[2]))

        em.persist(clinic)
    }

    scriptResult += 'Clinics have been imported successfully\n'

    for (o in owners) {
        Owner owner = new Owner()
        owner.setId(UUID.fromString(o[0]))
        owner.setFirstName(o[1])
        owner.setLastName(o[2])
        owner.setLocation(GeometryUtils.wktStringToPoint(o[3]))
        owner.setDistrict(em.find(District.class, UUID.fromString(o[4])))
        owner.setAddress('######')
        owner.setCity('Madrid')
        em.persist(owner)
    }

    scriptResult += 'Owners have been imported successfully\n'

    tx.commit()
} finally {
    tx.end()
}

return scriptResult
